import React from 'react';
import jsPDF from 'jspdf';
import 'jspdf-autotable';

const StudentTable = ({ students, loading }) => {
  // Ensure students is always an array
  const safeStudents = Array.isArray(students) ? students : [];

  // Debugging info
  console.log('StudentTable received:', safeStudents.length, 'students');
  if (safeStudents.length > 0) {
    console.log('First student example:', safeStudents[0]);
  }

  // Öğrenci görüntü adını oluştur
  const getStudentDisplayName = (student) => {
    // API'den dönen veriye göre farklı isim alanlarını kontrol et
    if (student.name) return student.name;
    if (student.firstName && student.lastName) return `${student.firstName} ${student.lastName}`;
    if (student.userName) return student.userName;
    if (student.displayName) return student.displayName;

    // İsim yoksa öğrenci numarasını göster
    if (student.studentNumber) return `Student ${student.studentNumber}`;

    // Fallback - default bir isim
    return `Student ID:${student.id || 'Unknown'}`;
  };

  // Öğrenci email'ini oluştur
  const getStudentEmail = (student) => {
    if (student.email) return student.email;
    if (student.studentNumber) return `${student.studentNumber}@university.edu`;
    return 'N/A';
  };

  const exportToPDF = () => {
    const doc = new jsPDF();
    doc.text('Student List', 14, 10);

    const tableColumn = ['Name', 'Email', 'Role'];
    const tableRows = safeStudents.map((student) => [
      getStudentDisplayName(student),
      getStudentEmail(student),
      student.role || 'Student',
    ]);

    doc.autoTable({
      head: [tableColumn],
      body: tableRows,
      startY: 20,
      theme: 'grid',
      headStyles: { fillColor: [155, 27, 27] },
    });

    doc.save('student-list.pdf');
  };

  const handleEditStudent = (studentId) => {
    console.log('Editing student:', studentId);
    // Burada öğrenciyi düzenleme sayfasına yönlendirme yapılabilir
    // window.location.href = `/edit-student/${studentId}`;
  };

  const handleDeleteStudent = (studentId) => {
    console.log('Deleting student:', studentId);
    if (window.confirm('Bu öğrenciyi silmek istediğinizden emin misiniz?')) {
      // Burada öğrenciyi silme API çağrısı yapılabilir
      console.log('Öğrenci silme onaylandı:', studentId);
    }
  };

  if (loading) {
    return <div>Öğrenciler yükleniyor...</div>;
  }

  if (!safeStudents.length) {
    return <div>Öğrenci bulunamadı. Lütfen API bağlantısını kontrol edin veya sistem yöneticisiyle iletişime geçin.</div>;
  }

  return (
    <div>
      {/* Export Button */}
      <div style={{ display: 'flex', justifyContent: 'flex-end', marginBottom: '1rem' }}>
        <button 
          onClick={exportToPDF} 
          style={exportBtnStyle}
          disabled={loading || !safeStudents.length}
        >
          Export to PDF
        </button>
      </div>

      {/* Student Table */}
      <div style={{ overflowX: 'auto' }}>
        <table style={tableStyle}>
          <thead>
            <tr>
              <th style={thStyle}>Name</th>
              <th style={thStyle}>Email</th>
              <th style={thStyle}>Role</th>
              <th style={thStyle}>Actions</th>
            </tr>
          </thead>
          <tbody>
            {safeStudents.map((student, i) => (
              <tr key={student.id || i}>
                <td style={tdStyle}>{getStudentDisplayName(student)}</td>
                <td style={tdStyle}>{getStudentEmail(student)}</td>
                <td style={tdStyle}>{student.role || 'Student'}</td>
                <td style={tdStyle}>
                  <div style={actionButtonsContainer}>
                    <button 
                      style={editButtonStyle} 
                      onClick={() => handleEditStudent(student.id)}
                      title="Edit Student"
                    >
                      Edit
                    </button>
                    <button 
                      style={deleteButtonStyle} 
                      onClick={() => handleDeleteStudent(student.id)}
                      title="Delete Student"
                    >
                      Delete
                    </button>
                  </div>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

// Table Styles
const tableStyle = {
  width: '100%',
  borderCollapse: 'collapse',
  marginTop: '2rem',
  fontFamily: 'Arial, sans-serif',
};

const thStyle = {
  backgroundColor: '#9B1B1B',
  color: 'white',
  fontWeight: 'bold',
  padding: '12px',
  border: '1px solid black',
  textAlign: 'left',
};

const tdStyle = {
  backgroundColor: '#e0e0e0',
  padding: '12px',
  border: '1px solid black',
  textAlign: 'left',
};

const exportBtnStyle = {
  width: '200px',
  height: '50px',
  padding: '10px 16px',
  backgroundColor: '#7b1fa2',
  color: 'white',
  border: 'none',
  borderRadius: '6px',
  fontWeight: 'bold',
  cursor: 'pointer',
};

const actionButtonsContainer = {
  display: 'flex',
  gap: '10px',
  justifyContent: 'center',
};

const editButtonStyle = {
  padding: '8px 16px',
  backgroundColor: '#7b1fa2',
  color: 'white',
  border: 'none',
  borderRadius: '4px',
  cursor: 'pointer',
  fontWeight: 'bold',
  minWidth: '80px',
};

const deleteButtonStyle = {
  padding: '8px 16px',
  backgroundColor: '#9C27B0',
  color: 'white',
  border: 'none',
  borderRadius: '4px',
  cursor: 'pointer',
  fontWeight: 'bold',
  minWidth: '80px',
};

export default StudentTable;
